import makeupBags from '../imgs/makeupBagImgs';
import pencilCases from '../imgs/pencilcaseImgs';


function Header(props){
  return(
    <section className="header">

    </section>
  );
}

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      imgAlone: false,
      gallery:[],
      functions : [
        this.bottleHolder.bind(this),
        this.lunchbox.bind(this),
        this.makeupBag.bind(this),
        this.pencilCase.bind(this)
      ]
    }
  }

  bottleHolder(){
    this.setState({gallery:bottleHolders})
  }

  lunchbox(){
    this.setState({gallery:lunchBoxes})
  }

  makeupBag(){
    this.setState({gallery:makeupBags})
  }

  pencilCase(){
    this.setState({gallery:makeupBags})
  }

  render(){
    return(
      <h1>Hola mundo</h1>
    );
  }
}

export default App;
